[47203554] = {id = 47203554, name = "戦刃の嵐", remark = "勝利の快感にイザベラはたまらない。どんな戦でも全力を尽くす！", des = "勝利の快感にイザベラはたまらない。どんな戦でも全力を尽くす！\n\n敵単体に（攻撃*damage_A%damage_B）点のダメージを与え、防御を2行動ターンダウンさせ（55%ダウン）、味方後列の会心を2行動ターンアップさせる（8%アップ）。同時に、猩紅の嵐を発動し、（攻撃*50%）の追加ダメージを与える。", des_level_up = "81050901:315", des_array = "敵単体にダメージを与え、防御を2行動ターンダウンさせ、味方後列の会心を2行動ターンアップさせる。同時に、猩紅の嵐を発動し、追加ダメージを与える。", icon_path = "SkillIcon:42003103", type = 2, targetType = 2001, damage = 315, damage_up = 0, damage_rate = 23600, damage_rate_up = 0, strike_prob = 0, fall_prob = 0, buff_odds = 10000, buff_list = "1:46031031:1000:10000,2:46031032:3006:10000,3:46031033:3001:10000", show_id = 42001101, add_attr = "0", add_attr_type = 0, fc = 0, need_quality = 0, need_star = 0, sort_index = 0}
