[47205417] = {id = 47205417, name = "縛り舞姫", remark = "踊り狂って、ひらりと風に舞うリボンが観客を絡めてしまう。", des = "踊り狂って、ひらりと風に舞うリボンが観客を絡めてしまう。\n\n敵単体に（攻撃*damage_A%damage_B)点のダメージを与え、2ラウンドの間、自身のいる横列及び自身の前か後にいる味方にライフリンクを付与する。\n\n「ライフリンク：行動ダメージを受けた時、この効果を持っている味方にdamage_E1%のダメージを分担させる。追加ダメージを受けた時、この効果を持っている味方にdamage_E2%のダメージを分担させる。ダメージを受けるたびに、自身に応援を1つ付与する。」\n※自身の覚醒レベルが高いほど、ライフリンク発動時の効果がアップする。覚醒するごとに味方が分担する行動ダメージの割合が5%アップし、追加ダメージの割合が10%アップする。\n※行動ダメージ：通常攻撃、奥義、特技、協撃による直接的ダメージ 。\n※追加ダメージ：通常攻撃、奥義、特技、協撃により追加で与える直接的ダメージ。", des_level_up = "81050901:154", des_array = "敵単体にダメージを与え、2ラウンドの間、自身のいる横列及び自身の前か後にいる味方にライフリンクを付与する。\n\n「ライフリンク：行動ダメージを受けた時、この効果を持っている味方にdamage_E1%のダメージを分担させる。追加ダメージを受けた時、この効果を持っている味方にdamage_E2%のダメージを分担させる。ダメージを受けるたびに、自身に応援を1つ付与する。」\n※自身の覚醒レベルが高いほど、ライフリンク発動時の効果がアップする。覚醒するごとに味方が分担する行動ダメージの割合が5%アップし、追加ダメージの割合が10%アップする。\n※行動ダメージ：通常攻撃、奥義、特技、協撃による直接的ダメージ 。\n※追加ダメージ：通常攻撃、奥義、特技、協撃により追加で与える直接的ダメージ。", icon_path = "SkillIcon:43002111", type = 3, targetType = 2001, damage = 0, damage_up = 0, damage_rate = 12800, damage_rate_up = 0, strike_prob = 0, fall_prob = 0, buff_odds = 10000, buff_list = "1:46121111:3071:10000,2:46121112:3071:10000,3:46121113:3071:10000", show_id = 43111006, add_attr = "0", add_attr_type = 0, fc = 0, need_quality = 0, need_star = 0, sort_index = 0, star_config_id = "46121111:46121112"}
