[47206027] = {id = 47206027, name = "神が賛嘆する矢", remark = "モニカが真剣に仕事をしている時、誰もが彼女の矢から逃げることはできない。", des = "モニカが真剣に仕事をしている時、誰もが彼女の矢から逃げることはできない。\n\n最もHPが低い敵に(攻撃*damage_A%damage_B)点のダメージを与える；目標のHPが20%超えの場合、追加で目標の最大HP10%（ギルドボス最大HP0.1%）分のダメージを与え、さらに50%の確率で1行動ターン気絶させる；目標のが20%以下の場合、即座にデッドする。\n\n「気絶：行動できない、ガードもできない」\n「デッド：シールドを無視し、直ちに目標を撃破する」", des_level_up = "81050901:287", des_array = "HPが最も低い敵にダメージを与える。目標のHPが20%以上の場合、追加でダメージを与える。目標のHPが20%以下の場合、即座に目標をデッドする。目標が撃破されると、自分のSPを回復する。\n\n「デッド：シールドを無視し、直ちに目標を撃破する」", icon_path = "SkillIcon:42003007", type = 2, targetType = 2141, damage = 0, damage_up = 0, damage_rate = 18800, damage_rate_up = 0, strike_prob = 0, fall_prob = 0, buff_odds = 10000, buff_list = "1:46030071:1000:10000,2:46030072:1000:10000,3:46030073:3001:10000", show_id = 42001101, add_attr = "0", add_attr_type = 0, fc = 0, need_quality = 0, need_star = 0, sort_index = 0}
