[47206421] = {id = 47206421, name = "メリークリスマス♪", remark = "せっかくのクリスマスなんだから、楽しまないとね。", des = "せっかくのクリスマスなんだから、楽しまないとね。\n\nランダムで敵3名に（攻撃*damage_A%damage_B)点のダメージを与える。\n1．自身のHPが50%以下の場合、自身に最大HP10%分のHPを回復し、50%の確率で相手に雪だるまを付与する。\n2．自身のHPが50%以上の場合、自身にリフレクションを付与し、50%の確率で相手に拘束を1行動ターン付与する。\n\n「雪だるま：相手を雪だるまにする。効果持続期間中、行動及びガードができなくなり、防御が100%ダウンする。1行動ターン持続。浄化不可」\n「リフレクション：行動ダメージを受けると、目標に（攻撃*80%）のダメージを与える。最大2回まで」\n「拘束：通常攻撃と特技が使用できない。協撃に参加しない」", des_level_up = "81050901:101", des_array = "ランダムで敵3名に（攻撃*damage_A%damage_B)点のダメージを与える。\n1．自身のHPが50%以下の場合、自身に最大HP10%分のHPを回復し、50%の確率で相手に雪だるまを付与する。\n2．自身のHPが50%以上の場合、自身にリフレクションを付与し、50%の確率で相手に拘束を1行動ターン付与する。\n\n「雪だるま：相手を雪だるまにする。効果持続期間中、行動及びガードができなくなり、防御が100%ダウンする。1行動ターン持続。浄化不可」\n「リフレクション：行動ダメージを受けると、目標に（攻撃*80%）のダメージを与える。最大2回まで」\n「拘束：通常攻撃と特技が使用できない。協撃に参加しない」", icon_path = "SkillIcon:42003015", type = 2, targetType = 2123, move_pos_type = 3, damage = 0, damage_up = 0, damage_rate = 15800, damage_rate_up = 0, strike_prob = 0, fall_prob = 0, buff_odds = 10000, buff_list = "1:47406401:3001:10000,5:47406403:3001:10000", show_id = 42111018, add_attr = "0", add_attr_type = 0, fc = 0, need_quality = 0, need_star = 0, sort_index = 1}
